insert into `tblInfoFields` (`fieldId`,`fieldName`,`fieldText`,`timeEdited`,`editedBy`,`hasFiles`) values (2,'page_download','Here you can download a current version of our adblock ruleset.\r\n\r\nYou can subscribe to a ruleset by using Adblock Plus, see the <a href=\"subscribe.php\">subscription page</a> for further instructions.\r\n\r\nSelect what categories of blocking rules you want included, if you are unsure\r\nof what these categories mean, please see the <a href=\"help.php\">help page</a>.\r\n\r\nYou can also <a href=\"ruleset.php\">browse</a> the ruleset online.\r\n\r\nThe rulesets are cached, and re-generated every 4 hours.','2006-11-07 20:38:34',1,0);
insert into `tblInfoFields` (`fieldId`,`fieldName`,`fieldText`,`timeEdited`,`editedBy`,`hasFiles`) values (3,'page_adblock','You\'d be suprised how many of the sites you visit daily have installed 3rd-party \"probes\" if you wish, that tracks your surf and e-shopping habits. Such \"web bugs\" usually report your referrer page back to a 3rd-party server. Other sites have similar functionality hosed on self-owned servers. The \"trackers\" collection of rules we distribute here tries to block all known web bugs.\r\n\r\nNote: This category does not block a visible component of a home page, but will result in negligbe increased page load time, and in higher integrity online.\r\n\r\n***\r\n\r\nThe digital age is good. Traditionally, we had to watch advertisments in magazines, on the streets, on the tv and the internet. Thanks to TiVo and piracy we got rid of the advertisment from the tv programs we like to watch.\r\n\r\nHere\'s the solution for advertisment on the internet.\r\n\r\nThis site provides a up-to-date list of rules to use together with Adblock Plus, that will block almost every advertisment on the internet of today.\r\n\r\nWhat are you waiting for? <a href=\"faq.php\">Get started!</a>\r\n\r\nOf course certain exceptions exist. Advertisment hosted on the site itself, with non-standard advertisment software, or with obscure url\'s may not get caught.\r\nBut here\'s the good deal. If you ever hit such a site, just visit the <a href=\"report_site.php\">report site</a> page and tell us! We will fix it.\r\n\r\nThis is a interactive community where you are welcome to join in and help us! Please report broken sites, or sites where advertisments are still seen to us.\r\n\r\nHere is an example screenshot, to the left a \"before\" picture of svd.se, a very popular swedish news site, and crippled with ads. To the right is the same site with ABP running.\r\n\r\n(Click the images for bigger pictures)','2006-11-06 23:35:42',1,1);
