insert into `tblInfoFields` (`fieldId`,`fieldName`,`fieldText`,`timeEdited`,`editedBy`,`hasFiles`) values (17,'page_newuser','New user registration\r\n\r\nChoose a username and a password below.\r\n\r\nPlease also specify a email address, it is not displayed on the site.\r\nIt can be used in case you forget your password, or to be notified of certain events if you so choose (such as changes to the site).\r\n\r\nYour IP are logged, by registering you accept this.','2006-02-18 02:17:51',1,0);
