insert into `tblInfoFields` (`fieldId`,`fieldName`,`fieldText`,`timeEdited`,`editedBy`,`hasFiles`) values (20,'page_new_adblock_rule','Add new adblock rule to database.\r\n\r\nKeep the \"Make this comment private\" checkbox checked to only display this comment for other admins.\r\n\r\nBefore you add a new rule, make sure it doesnt already exist,\r\nby <a href=\"ruleset.php\">searching the current ruleset</a>','2006-03-09 14:50:21',1,0);
insert into `tblInfoFields` (`fieldId`,`fieldName`,`fieldText`,`timeEdited`,`editedBy`,`hasFiles`) values (21,'page_help','[b]Adblock filters FAQ[/b]\r\n\r\n[b]1. How to directly download custom rulesets[/b]\r\nThis might be useful if you want to subscribe to only one part of the ruleset (for example only ads), or need the ruleset for other purposes.\r\n \r\nExample query: http://martin/adblock/download.php?type=all\r\n\r\nSet type to one of the following:\r\nall - For all rules\r\nads - For ads only\r\ntrackers - For trackers only\r\ncounters - For counters only\r\nunsorted - For unsorted entries\r\n\r\n[b]2. Text missing[/b]\r\nDescribe how to analyze a website, and how to create new adblock rules from that information.','2006-11-06 23:44:06',1,0);
insert into `tblInfoFields` (`fieldId`,`fieldName`,`fieldText`,`timeEdited`,`editedBy`,`hasFiles`) values (22,'page_about','The set of Adblock filters we distribute from this website are to be used as-is.\r\nPermission is granted for modification, replication and inclusion in any software, commercial or not.\r\n\r\nWe need donations to survive!\r\n\r\nWe are a non profit project and are currently paying server costs of our own pockets, and as popularity of the Adblock & ABP extensions, we will most likley need more server capacity to handle the load. Currently the costs are of roughly 20 US $ a month.\r\n\r\nWe are accepting PayPal donations.\r\n\r\nPlease consider donating at least 1 US $, we will publish donations recieved and where money is spent for public critisism.\r\n[b]\r\nCurrent status:\r\n\r\nDonations recieved: 0 US $\r\nMoney spent between 2007.01.01 and 2007.03.31: 0 US $[/b]','2006-11-06 22:51:54',1,0);
insert into `tblInfoFields` (`fieldId`,`fieldName`,`fieldText`,`timeEdited`,`editedBy`,`hasFiles`) values (23,'page_contribute','You can help out in many ways!\r\n\r\n- You can help by <a href=\"report_site.php\">reporting sites</a> where ads are shown, or where legit content are being blocked by the ruleset.\r\n\r\n- You can directly <a href=\"ruleset.php\">browse the ruleset</a> (<a href=\"javascript:addFilterSearchEngine()\">Install Firefox search engine</a>).','2006-11-06 22:52:30',1,0);
insert into `tblInfoFields` (`fieldId`,`fieldName`,`fieldText`,`timeEdited`,`editedBy`,`hasFiles`) values (24,'page_admin_geoip_cities','Admingrnssnitt fr geoip cities databaserna.\r\n\r\nAnge iprange och plats den tillhr.\r\n\r\nFr att hitta en iprange utifrn ett IP-nummer, anvnd http://www.ripe.net/whois och kolla efter\r\n\r\ninetnum:         213.100.0.0 - 213.100.127.255\r\nnetname:         SE-SWIPNET-000403\r\n\r\nDetta r siffrorna som ska fyllas i nedan','2006-03-10 23:28:30',1,0);
