insert into `tblInfoFields` (`fieldId`,`fieldName`,`fieldText`,`timeEdited`,`editedBy`,`hasFiles`) values (27,'page_subscribe','[b]How to subscribe - Adblock Plus[/b]\r\n\r\nOpen Adblock Plus preferences (Ctrl-Shift-A)\r\nSelect \"Add filter subscription...\" in Filters menu\r\n\r\nIn this dialog, enter \r\nhttp://martin2/adblock/download.php?type=all\r\n\r\nClose the dialog and you should see the preferences listbox update with new content.\r\n\r\nSee the <a href=\"help.php\">help page</a> for more info.','2006-11-16 00:57:07',1,0);
insert into `tblInfoFields` (`fieldId`,`fieldName`,`fieldText`,`timeEdited`,`editedBy`,`hasFiles`) values (28,'page_ruleset','Here you can browse the complete ruleset. You can also add comments to specific rules if you wish. Please mention if the rule is blocking legit content for you.\r\n\r\nIf you wish to download the most recent snapshot of the rulesets, please see <a href=\"download.php\">this page</a>.\r\n\r\ntodo:\r\n- lt folk rsta p en regel: bra/dlig, fr att kunna rensa bort dliga regler enkelt','2006-11-07 21:10:39',1,0);
insert into `tblInfoFieldsHistory` (`fieldId`,`fieldText`,`editedBy`,`timeEdited`) values (4,'1. Install Mozilla Firefox from http://www.mozilla.com/firefox/\r\n\r\n2. Install the Adblock Plus extension from http://adblockplus.mozdev.org/installation.html\r\n\r\n3. Open Adblock Plus preferences (Ctrl-Shift-A)\r\nSelect \"Add filter subscription...\" in Filters menu\r\n[image127]\r\n\r\nIn this dialog, you enter the location of the rules you wish to subscribe on\r\n[image128]\r\nExample: http://81.216.159.67:16200/adblock/download.php?type=all\r\n\r\nSet type to one of the following:\r\nall - For all rules\r\nads - For ads only\r\ntrackers - For trackers only\r\ncounters - For counters only\r\nunsorted - For unsorted entries\r\n\r\nClose the dialog and you should see the preferences listbox update with new content\r\n[image129]\r\n\r\nAdblock Plus will now regulary update your local ruleset from our database.\r\n\r\nAll done! Test it all out by visiting one of these ad-infested sites:\r\n\r\nhttp://www.aftonbladet.se/\r\nhttp://www.expressen.se/\r\nhttp://www.dn.se/\r\nhttp://www.svd.se/',1,'2006-03-11 05:23:43');
