insert into `tblInfoFieldsHistory` (`fieldId`,`fieldText`,`editedBy`,`timeEdited`) values (4,'[b]How to get started[/b]\r\n\r\n1. Install Mozilla Firefox from http://www.mozilla.com/firefox/\r\n\r\n2. Install the Adblock Plus extension from http://adblockplus.mozdev.org/installation.html\r\n\r\n3. Open Adblock Plus preferences (Ctrl-Shift-A)\r\nSelect \"Add filter subscription...\" in Filters menu\r\n[image127]\r\n\r\nIn this dialog, you enter the location of the rules you wish to subscribe on\r\n[image128]\r\nExample: http://81.216.159.67:16200/adblock/download.php?type=all\r\n\r\nSet type to one of the following:\r\nall - For all rules\r\nads - For ads only\r\ntrackers - For trackers only\r\ncounters - For counters only\r\nunsorted - For unsorted entries\r\n\r\nClose the dialog and you should see the preferences listbox update with new content\r\n[image129]\r\n\r\nAdblock Plus will now regulary update your local ruleset from our database.\r\n\r\nAll done! Test it all out by visiting one of these ad-infested sites:\r\n\r\nhttp://www.aftonbladet.se/\r\nhttp://www.expressen.se/\r\nhttp://www.dn.se/\r\nhttp://www.svd.se/',1,'2006-03-14 02:29:18');
