insert into `tblInfoFieldsHistory` (`fieldId`,`fieldText`,`editedBy`,`timeEdited`) values (3,'The digital age is good. Traditionally, we had to watch advertisments in magazines, on the streets, on the tv and the internet. Thanks to TiVo and piracy we got rid of the advertisment from the tv programs we like to watch.\r\n\r\nHere\'s the solution for advertisment on the internet.\r\n\r\nThis site provides a up-to-date list of rules to use together with Adblock Plus, that will block almost every advertisment on the internet of today.\r\n\r\nWhat are you waiting for? <a href=\"faq.php\">Get started!</a>\r\n\r\nOf course certain exceptions exist. Advertisment hosted on the site itself, with non-standard advertisment software, or with obscure url\'s may not get caught.\r\nBut here\'s the good deal. If you ever hit such a site, just visit the <a href=\"report_site.php\">report site</a> page and tell us! We will fix it.\r\n\r\nThis is a interactive community where you are welcome to join in and help us! Please report broken sites, or sites where advertisments are still seen to us.\r\n\r\nHere is an example screenshot, to the left a \"before\" picture of svd.se, a very popular swedish news site, and crippled with ads. To the right is the same site with ABP running.\r\n\r\n [image125] [image126]\r\n\r\n(Click the images for bigger pictures)',1,'2006-03-22 20:41:55');
insert into `tblInfoFieldsHistory` (`fieldId`,`fieldText`,`editedBy`,`timeEdited`) values (4,'[b]How to get started[/b]\r\n\r\n1. Install the Adblock Plus extension from http://adblockplus.org/en/installation\r\n\r\n2. Open Adblock Plus preferences (Ctrl-Shift-A)\r\nSelect \"Add filter subscription...\" in Filters menu\r\n\r\nIn this dialog, enter \r\nhttp://87.227.76.225/adblock/download.php?type=all\r\n\r\nClose the dialog and you should see the preferences listbox update with new content\r\n\r\nDone. Adblock Plus will now regulary update your ruleset from our website.',1,'2006-08-29 20:33:13');
insert into `tblInfoFieldsHistory` (`fieldId`,`fieldText`,`editedBy`,`timeEdited`) values (22,'We need donations to survive!\r\n\r\nWe are a non profit project and are currently paying server costs of our own pockets, and as popularity of the Adblock & ABP extensions, we will most likley need more server capacity to handle the load. Currently the costs are of roughly 20 US $ a month.\r\n\r\nWe are accepting PayPal donations.\r\n\r\nPlease consider donating at least 1 US $, we will publish donations recieved and where money is spent for public critisism.\r\n[b]\r\nCurrent status:\r\n\r\nDonations recieved: 0 US $\r\nMoney spent between 2006.03.01 and 2006.04.01: 0 US $[/b]',1,'2006-03-22 20:38:37');
