insert into `tblInfoFieldsHistory` (`fieldId`,`fieldText`,`editedBy`,`timeEdited`) values (12,'Adblock filters technical FAQ\r\n\r\nThis text tries to describe how to analyze a website, and how to create new adblock rules from that information.\r\n\r\n***\r\n\r\nThe set of Adblock filters we distribute from this website are to be used as-is.\r\nPermission is granted for modification, replication and inclusion in any software, commercial or not.\r\n\r\n***\r\n\r\nExample: http://87.227.76.225/adblock/download.php?type=all\r\n\r\nSet type to one of the following:\r\nall - For all rules\r\nads - For ads only\r\ntrackers - For trackers only\r\ncounters - For counters only\r\nunsorted - For unsorted entries',1,'2006-08-29 20:32:27');
